import AgentForm from '../components/AgentForm';
import AgentList from '../components/AgentList';

export default function AgentsPage() {
  return (
    <div style={{ maxWidth: 800, margin: '2rem auto' }}>
      <h1>Agents</h1>
      <AgentForm />
      <hr style={{ margin: '1rem 0' }} />
      <AgentList />
    </div>
  );
}
